function getRelevantCells() {
    // Extract table from HTML
    var table = document.getElementsByTagName("table")[0];

    // Get data from table headers
    var headerRow = table.rows[0];
    var columns = [];
    for (var i = 1; i < headerRow.cells.length; i++) {
        columns.push(headerRow.cells[i].textContent);
    }

    // Find rows where player, country and score match the claim
    var resultRows = [];
    for (var i = 2; i < table.rows.length; i++) {
        if (
            table.rows[i].cells[1].textContent === "J B Holmes" &&
            table.rows[i].cells[2].textContent === "United States" &&
            table.rows[i].cells[3].textContent.includes("209")
        ) {
            resultRows.push(table.rows[i]);
        }
    }

    // If we found any matching rows, add the cell containing the score to the relevant cells list
    if (resultRows.length > 0) {
        var jBHolmesRow = resultRows[0];
        for (var i = 4; i < columns.length; i++) {
            var value = jBHolmesRow.cells[i].textContent;
            // Check if the value is a number and if the row index matches
            if (!isNaN(value) && value !== "" && parseInt(value) === 209) {
                return {
                    "answer": "TRUE",
                    "relevant_cells": [
                        {"row_index": jBHolmesRow.rowIndex, "column_name": columns[i]},
                        {"row_index": resultRows.length - 1, "column_name": columns[i]}
                    ]
                };
            }
        }
    } else {
        return { answer: "FALSE" };
    }

    // If we didn't find any matching rows, check for other players
    var stensonRow = resultRows.find((row) => row.cells[1].textContent === "Henrik Stenson");
    if (stensonRow) {
        for (var i = 4; i < columns.length; i++) {
            var value = stensonRow.cells[i].textContent;
            // Check if the value is a number and if the row index matches
            if (!isNaN(value) && value !== "" && parseInt(value) === 209) {
                return {
                    "answer": "TRUE",
                    "relevant_cells": [
                        {"row_index": stensonRow.rowIndex, "column_name": columns[i]},
                        {"row_index": resultRows.length - 1, "column_name": columns[i]}
                    ]
                };
            }
        }
    }

    // If we didn't find any matching rows, return false
    return { answer: "FALSE" };
}

